import React from "react";
import { Card, CardText, CardBody, CardTitle } from "reactstrap";
import "../../styles.css";

const cards = ({ postdata }) => {
  return (
    <div className="col-md-4 h-25">
      <Card className="customcard">
        <CardBody>
          <CardTitle>
            <b>{postdata.title}</b>
          </CardTitle>
          <br />
          <CardText>{postdata.id}</CardText>
        </CardBody>
      </Card>
    </div>
  );
};

export default cards;
